import React from 'react';
import Wrapper from '../components/Wrapper';
import styles from '../style/actionMovie.module.scss';


export default function Contact() {
    return (
        <div className={styles.body}>
            <div className={styles.img_parent}>
                <div>
                    <div class="d-flex justify-content-center">
                        <div class=" w-100 ml-0" >
                            <img src="https://mdbcdn.b-cdn.net/img/Photos/Thumbnails/Slides/1.jpg" alt="Gallery image 1" class="w-100" />
                        </div><div class="w-100 ml-0" >
                            <img src="https://mdbcdn.b-cdn.net/img/Photos/Thumbnails/Slides/2.jpg" alt="Gallery image 2" class="w-100" />
                        </div><div class="w-100 ml-0" >
                            <img src="https://mdbcdn.b-cdn.net/img/Photos/Thumbnails/Slides/3.jpg" alt="Gallery image 3" class="w-100" />
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
